import React from "react";
import "./style.css";
import { Row, Col, Card, CardTitle } from 'react-materialize';

const ChefCards = props => {
    return (
        <Row className="chefCardRow">
        <Col l={3} m={6} s={12}>
        <Card className="chefcard" header={<CardTitle>{props.title}</CardTitle>} actions={[<a href={props.image}/>]}>
        </Card>
        </Col>

        <Col l={3} m={6} s={12}>
        <Card className="chefcard" header={<CardTitle>{props.title}</CardTitle>} actions={[<a href={props.image}/>]}>
        </Card>
        </Col>
        </Row>
    );
}

export default ChefCards;
